!function(){Template.__checkName("home"),Template.home=new Template("Template.home",function(){var e=this;return[HTML.DIV("\n    ",HTML.Raw("<h2>Save the date: Wednesday, Thursday 11-12 March 2015</h2>"),"\n    ",HTML.Raw('<p class="lead">Where: at the <strong>Technion faculty of CS, Haifa</strong></p>'),"\n    ",Blaze.If(function(){return Spacebars.call(e.lookup("registrationOpen"))},function(){return["\n      ",HTML.P({"class":"lead"},"Registration is open. ",HTML.A({href:"/register","class":"btn btn-success"},"Register here")),"\n    "]}),"\n    ",HTML.Raw('<p class="lead">Agenda is now public. <a href="/agenda.html" class="btn btn-success">See the agenda</a></p>'),"\n    ",HTML.Raw("<h2>Important Dates</h2>"),"\n    ",HTML.Raw("<ul>\n      <li><em>Call for Proposals</em> starts Jan 20, <strong>ends Jan 27</strong> (7 days)</li>\n      <li><em>Voting</em> starts Jan 28, <strong>ends Jan 31</strong> (4 days)</li>\n      <li><em>Review</em> starts Feb 1, <strong>ends Feb 11</strong> (11 days)</li>\n      <li><em>Final session selection:</em> <strong>Feb 11</strong></li>\n      <li><em>Registration</em> starts <strong>Feb 18</strong></li>\n      <li><em>Conference</em> <strong>March 11-12</strong></li>\n    </ul>"),"\n    ",Blaze.If(function(){return Spacebars.call(e.lookup("votingEnabled"))},function(){return["\n      ",HTML.H2("Voting is open"),"\n      ",HTML.P({"class":"lead"},"\n          Voting is open until Jan 31. ",HTML.A({href:"/vote","class":"btn btn-lg btn-info"},"Vote here"),"\n      "),"\n    "]}),"\n    ",Blaze.If(function(){return Spacebars.call(e.lookup("cfpEnabled"))},function(){return["\n      ",HTML.P({"class":"lead"},"\n        You may now ",HTML.A({href:"/propose","class":"btn btn-success"},"Submit a proposal"),"\n      "),"\n    "]},function(){return["\n      ",HTML.P("The CFP is now closed"),"\n    "]}),"\n    ",Blaze.If(function(){return Spacebars.call(e.lookup("wishEnabled"))},function(){return["\n      ",HTML.P({"class":"lead"},"\n        You may ",HTML.A({href:"/wishes","class":"btn btn-success"},"Make a wish or Vote"),"\n      "),"\n    "]}),"\n    \n  "),HTML.Raw("\n\n  <div class=\"row marketing\">\n    <div class=\"col-lg-6\">\n      <h4>Topics</h4>\n      <p>\n        You may get a good sense of the topics we're interested in by looking into previous events: <a href=\"http://summit2013.reversim.com\">Reversim Summit 2013</a> and <a href=\"http://summit2014.reversim.com\">Reversim Summit 2014</a>\n      </p>\n      <p>\n        Apart from that, here's a good grocery list of topics just to give you ideas.\n        We're interested in everything including software development,\n        software product development, UX, startups mobile, web, devops,\n        data processing, scaling and more.\n        You should know - this is not a closed list, if your topic doesn't seem to fit here\n        and is of general interest, we want it!\n      </p>\n      <p>\n        We do not set out a predefined list of tracks. We would like to leave the\n        topics (tracks) open and only after accepting the submissions we might devide up to tracks, but we shall not rule out a single good talk just b/c it's not a natural fit to any of the predefined list, so don't worry so much about categorizing your submissions.\n      </p>\n    </div>\n\n    <div class=\"col-lg-6\">\n      <h4>Full Featured talks</h4>\n      <p>\n        Full feature are frontal presentations b/w 30 - 40 minutes. They will be held in either the large room (300 ppl) or the small room (100 ppl) in two parallel sessions\n      </p>\n      <h4>Lightning Talks</h4>\n      <p>\n        Lightning are speedy 5 min talks. They will be presented in a series in which each presenter has exactly 20 slides, 15 sec per slide, slides are auto advanced and in total 5 min. No break b/w the sessions. It's fun, it's speedy, it's consice and it's breathtaking :-)\n      </p>\n      \n      <h4>Open Source in Israel</h4>\n      <p>\n        We are especially interested in open source projects made in israel or created\n        by Israelis. We will have a special stage for that.\n      </p>\n    </div>\n  </div>")]})}();

